testcase.system-out:

            @scenario.begin
                @Common
                scenario: Acessar a pagina de cadastro
                given que eu estou na pagina "Home" ... passed in 0.1281s 
                when eu clico em "Cadastra-se para fazer entregas" ... passed in 0.09527s 
                then eu devo ver a pagina de cadastro ... passed in 0.03875s 
@scenario.end
